import React, { useState } from 'react'
import NavigationBar from '../shared/navbar'
import { Form, InputGroup, Button } from 'react-bootstrap'

import ProductCard from './components/ProductCard'

const products = [
    {
        id: 1,
        name: "Musica Open Source",
        version: "1.0.21"
    },
    {
        id: 2,
        name: "Game engine PSA",
        version: "1.5.22"
    },
    {
        id: 3,
        name: "Windows 11",
        version: "1.0.00"
    },
    {
        id: 4,
        name: "Antivirus PSA",
        version: "1.4.36"
    },
    {
        id: 5,
        name: "Antivirus PSA",
        version: "2.0.00"
    },
    {
        id: 6,
        name: "Not Photoshop",
        version: "1.0.25"
    },
    {
        id: 7,
        name: "Antivirus PSA-Linux",
        version: "1.6.40"
    },
    {
        id: 8,
        name: "Aduana Evader",
        version: "2.0.22"
    },
    {
        id: 9,
        name: "Adblock PSA-Chrome",
        version: "1.3.02"
    },
    {
        id: 10,
        name: "Adblock PSA-Firefox",
        version: "1.1.13"
    },
    {
        id: 11,
        name: "Sea of thieves",
        version: "1.9.29"
    },
    {
        id: 12,
        name: "PSA PDF Reader",
        version: "0.5.40"
    },
    {
        id: 13,
        name: "PSA Video Editing Software",
        version: "2.3.01"
    },
    {
        id: 14,
        name: "PSA Facturacion Automatica",
        version: "1.0.32"
    },
    {
        id: 15,
        name: "PSA Modeling Software",
        version: "9.2.03"
    },
    {
        id: 16,
        name: "Sea of thieves Xbox",
        version: "1.9.29"
    },
    {
        id: 17,
        name: "Editor de Sonido PSA-Alpha",
        version: "0.1.22"
    },
    {
        id: 18,
        name: "Colorblind Test app",
        version: "1.1.22"
    },
    {
        id: 10,
        name: "Colorblind Test - Portuguese",
        version: "1.0.00"
    },
    {
        id: 20,
        name: "Tax Evader",
        version: "0.1.22"
    },
]

export default function Support() {
    const [productList, setProductList] = useState(products)
    const [inputSearch, setInputSearch] = useState("")

    const searchProducts = (searchText) => {
        if(!searchText || searchText === ""){
            setProductList(products)
            return;
        } 
        const filteredProducts = products.filter((item) => (item.name.includes(searchText)))
        setProductList(filteredProducts);
    }


    return (
        <div style={{backgroundColor:'#eee', color:'black'}}>
            <NavigationBar/>
            <div style={{marginTop:'1%'}}>
            <ul style={{  padding: '10px 5%',  listStyle: 'none',  backgroundColor:'#E0E0E0', color: 'black', flexDirection:'row', display:'flex'}}>
                <li style={{marginRight:'5px'}}><a href="/home"> Home</a> / </li>
                <li style={{marginRight:'5px'}}><a href="/soporte"> Soporte</a> / </li>
                <li style={{marginRight:'5px'}}>Productos</li>
            </ul>
                <h3 style={{marginLeft:'5%'}}>Productos</h3>
                <Form style={{width:'30%', alignContent:'center',marginTop: '1.5%', display:'flex', marginLeft:'33%'}}>
                    <InputGroup className="mb-3">
                        <Form.Control onChange={(e) => setInputSearch(e.target.value)} type="search" placeholder="Buscar producto"/>
                        <InputGroup.Append>
                            <Button  variant="primary" style={{backgroundColor:'#045174',color:'white' }} onClick={() => searchProducts(inputSearch)}>Buscar</Button>
                        </InputGroup.Append>
                    </InputGroup>
                </Form>
                <div 
                    style=
                    {{
                        display:'flex',
                        flexWrap: 'wrap',
                        marginLeft:'3%',
                        marginRight:'3%',
                        borderStyle:'solid',
                        borderWidth:'1px',
                        borderColor:'#E0E0E0',
                        borderRadius: '1%',
                        paddingBottom:'2%',
                        marginBottom:'5%',
                        marginTop:'1%',
                        backgroundColor:'#E0E0E0'

                    }}>
                    {
                        productList.length !== 0 ?
                        productList.map((item) => (
                            <ProductCard name={item.name} version={item.version} id={item.id}/>
                        )) :
                        <h3>No hay resultados disponibles.</h3>
                    }
                </div>
            </div>
        </div>
    )
}
